#' Raw Example Dataset
#' 
#' The dataset contains pseudo mzXML files of three species (A,B,C) with two different strains per species.
#' The dataset also contains description files of given mzXML files.
#' There are 23 mzXML files (10 files for species A, 7 files for species B, and 6 files for species C).
#' 
#' The list files contains data descriptions. For example, listA.txt contains a file description for species A. 
#' There are three list files for species A, B, and C: listA.txt, listB.txt, listC.txt.
#' 
#' @format The list files (e.g. listA.txt) contains three columns:
#' \descrbie{
#' \item{file.name}{Names of mzXML files.}
#' \item{strain.no}{Positive integers starting from one.}
#' \item{strain}{Strain names.}
#' }
#' 
